import React from 'react';
import './App.css';
import Form from './Form.js';

function App(){ 
  const tweets:string[] = [];
  const onSubmit = (tweet:string)=>{
    tweets.push(tweet);
}




  return(
    <div className="App">
      <header className="App-header">
        <h1> Tweeter </h1>
        <Form onSubmit = {onSubmit}/>
      </header>
    </div>
  );
}

export default App;
